import { combineReducers } from "redux";
import { contacts } from "./contactReducer";
import filter from "./filterReducer";
import { alertReducer } from "./alertReducers";
const rootRreducer = combineReducers({
  contacts,
  filter,
  alertReducer,
});

export default rootRreducer;
